css:
.react-tabs {
  flex: 1;
  display: flex;
  flex-direction: column;
}
.react-tabs__tab-panel--selected {
  flex: 1;
  overflow: auto;
}
.github-tab {
  padding: 7.5px 22.5px;
  text-align: center;
  font-weight: 600;
  color: #8488aa;
  cursor: default;
  user-select: none;
}
.github-tablist {
  flex: none;
  display: flex;
  justify-content: center;
  padding: 0;
  margin: 0;
  list-style: none;
  border-bottom: 1px solid #313557;
  background-color: #282b47;
}
.github-tab-icon {
  color: #505472;
  vertical-align: middle;
}
.github-tab-icon:before {
  margin-right: .4em;
}
.github-tab-count {
  display: inline-block;
  background-color: #373a5c;
  border-radius: 3px;
  padding: 0 .25em;
  margin-left: 7.5px;
}
.github-tab.react-tabs__tab--selected {
  color: #d3b1c0;
  box-shadow: 0 1px 0 #4b5185;
}
.github-tab.react-tabs__tab--selected .github-tab-icon {
  color: #a3a7cb;
}
